  return (
    <Container>
      <ItemText>
        <p>Home</p>
        <p>About us</p>
      </ItemText>
    </Container>

  
  )
}

export default Header

const Container=styled.div`
height:70px;
background-color:#090b13; 

`
const ItemText=styled.div`
color:white;
Display:flex;
cursor:pointer;
align-item:center;
`
